(36, 76, 1, '<p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">what you pay is what you get.You will need to look at what are the top resources consumers in your system.DTU is nothing, but a limit on CPU,IO,Memory available to your database..</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">so to troubleshoot DTU problems,I would follow below steps..</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">1.)Below query gives me Resource usage for last 14 days for all resources..</p><pre style="margin-bottom: 1em; padding: 5px; border-width: 0px; border-style: initial; border-color: initial; width: auto; max-height: 600px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); word-wrap: normal; color: rgb(36, 39, 41);"><code style="margin: 0px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: inherit;">SELECT \r\n    (COUNT(end_time) - SUM(CASE WHEN avg_cpu_percent &gt; 80 THEN 1 ELSE 0 END) * 1.0) / COUNT(end_time) AS ''CPU Fit Percent''\r\n    ,(COUNT(end_time) - SUM(CASE WHEN avg_log_write_percent &gt; 80 THEN 1 ELSE 0 END) * 1.0) / COUNT(end_time) AS ''Log Write Fit Percent''\r\n    ,(COUNT(end_time) - SUM(CASE WHEN avg_data_io_percent &gt; 80 THEN 1 ELSE 0 END) * 1.0) / COUNT(end_time) AS ''Physical Data Read Fit Percent''\r\nFROM sys.dm_db_resource_stats\r\n</code></pre><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">running above query gives you an idea on how much is your CPU percentage consistently</p>', 1, '2016-10-18 09:09:25', 0),
(37, 76, 2, '<p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">Below query gives me an idea of resource usage over time..</p><pre style="margin-bottom: 1em; padding: 5px; border-width: 0px; border-style: initial; border-color: initial; width: auto; max-height: 600px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); word-wrap: normal; color: rgb(36, 39, 41);"><code style="margin: 0px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: inherit;">SELECT start_time, end_time,   \r\n  (SELECT Max(v)    FROM (VALUES (avg_cpu_percent), (avg_physical_data_read_percent), (avg_log_write_percent)) AS value(v)) as [avg_DTU_percent] \r\nFROM sys.resource_stats where database_name = â€˜&lt;your db name&gt;â€™ order by end_time desc\r\n</code></pre><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">Now that ,i have enough data to look out which metric is more resource intensive,I can follow normal approach of trying to troubleshoot..</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">Say for Example,if my CPU usage is above 90% consistently over time,I will gather all the queries which are consuming more CPU and try to fine tune them</p>', 0, '2016-10-18 09:10:24', 0),
(38, 77, 1, '<p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">No, there isn''t built in support for tables per&nbsp;<a href="https://meta.stackexchange.com/questions/73566/is-there-any-markdown-to-create-tables" style="margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: dotted; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(59, 64, 69); border-left-color: initial; border-image: initial; color: rgb(83, 90, 96); cursor: pointer;">Is there any markdown to create tables?</a>&nbsp;(note that it says&nbsp;<a href="http://meta.stackoverflow.com/questions/tagged/status-declined" class="post-tag moderator-tag" title="" rel="tag" style="margin-top: 2px; margin-right: 2px; margin-left: 0px; padding: 0.4em 0.5em; border: 1px solid rgb(238, 196, 200); font-size: 12px; color: rgb(83, 90, 96); cursor: pointer; position: relative; display: inline-block; line-height: 1; white-space: nowrap; text-align: center; border-radius: 0px; transition: all 0.15s ease-in-out; background-color: rgb(249, 236, 238); margin-bottom: 0px !important;">status-declined</a>). Meanwhile, you can try&nbsp;<a href="http://www.sensefulsolutions.com/2010/10/format-text-as-table.html" rel="nofollow" style="margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: dotted; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(59, 64, 69); border-left-color: initial; border-image: initial; color: rgb(83, 90, 96); cursor: pointer;">Senseful Solutions</a>. The following:</p><pre style="margin-bottom: 1em; padding: 5px; border-width: 0px; border-style: initial; border-color: initial; width: auto; max-height: 600px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); word-wrap: normal; color: rgb(36, 39, 41);"><code style="margin: 0px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: inherit;">Col1    Col2    NumCol\r\nValue 1 Value 2 123\r\nThis is a row with only one cell\r\nThis row is testing html entities   Te&lt;br /&gt;st  45\r\n</code></pre><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">...will output...</p><pre style="margin-bottom: 1em; padding: 5px; border-width: 0px; border-style: initial; border-color: initial; width: auto; max-height: 600px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); word-wrap: normal; color: rgb(36, 39, 41);"><code style="margin: 0px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: inherit;">+-----------------------------------+------------+--------+\r\n|               Col1                |    Col2    | NumCol |\r\n+-----------------------------------+------------+--------+\r\n| Value 1                           | Value 2    |    123 |\r\n| This is a row with only one cell  |            |        |\r\n| This row is testing html entities | Te&lt;br /&gt;st |     45 |\r\n+-----------------------------------+------------+--------+\r\n</code></pre><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">As pointed out by&nbsp;<a href="https://meta.stackoverflow.com/questions/277716/how-to-create-table-in-so-question#comment121121_277716" style="margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: dotted; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(59, 64, 69); border-left-color: initial; border-image: initial; color: rgb(83, 90, 96); cursor: pointer;">Jongware</a>, put&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">&lt;!-- language: lang-none --&gt;</code>&nbsp;before the tables incase they get syntax-highlighted. I formatted them using the Code Sample button (<kbd style="margin: 0px 0.1em; padding: 0.1em 0.6em; border: 1px solid rgb(173, 179, 185); font-size: 11px; display: inline-block; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; line-height: 1.4; color: rgb(36, 39, 41); text-shadow: rgb(255, 255, 255) 0px 1px 0px; background-color: rgb(225, 227, 229); box-shadow: rgba(12, 13, 14, 0.2) 0px 1px 0px, rgb(255, 255, 255) 0px 0px 0px 2px inset; white-space: nowrap;">CTRL</kbd>+<kbd style="margin: 0px 0.1em; padding: 0.1em 0.6em; border: 1px solid rgb(173, 179, 185); font-size: 11px; display: inline-block; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; line-height: 1.4; color: rgb(36, 39, 41); text-shadow: rgb(255, 255, 255) 0px 1px 0px; background-color: rgb(225, 227, 229); box-shadow: rgba(12, 13, 14, 0.2) 0px 1px 0px, rgb(255, 255, 255) 0px 0px 0px 2px inset; white-space: nowrap;">K</kbd>). If you use&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">&lt;pre&gt;</code>, it will render HTML tags inside (which may be desirable or not.)</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">This website was already suggested by&nbsp;<a href="http://meta.stackexchange.com/a/139013/231078" style="margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: dotted; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(59, 64, 69); border-left-color: initial; border-image: initial; color: rgb(83, 90, 96); cursor: pointer;">Arjan</a>&nbsp;on the above question. Please see their answer for more sample outputs. Meanwhile, their answer says:</p>', 1, '2016-10-18 09:13:08', 0),
(39, 78, 1, '<p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">All You have to do is&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">git push origin master</code>, where&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">origin</code>&nbsp;is the default name (alias) of Your remote repository and&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">master</code>&nbsp;is the remote branch You want to push Your changes to.</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">You may also want to check these out:</p><ol style="margin-right: 0px; margin-bottom: 1em; margin-left: 30px; padding: 0px; border: 0px; font-size: 15px; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;"><li style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; word-wrap: break-word;"><a href="http://gitimmersion.com/" style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 89, 153); cursor: pointer;">http://gitimmersion.com/</a></li><li style="margin: 0px; padding: 0px; border: 0px; word-wrap: break-word;"><a href="http://progit.org/book/" style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 89, 153); cursor: pointer;">http://progit.org/book/</a></li></ol>', 1, '2016-10-18 09:16:42', 0),
(40, 78, 2, '<p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">Have you tried&nbsp;<a href="http://gitref.org/remotes/#push" rel="nofollow" style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 89, 153); cursor: pointer;">git push</a>?&nbsp;<a href="http://gitref.org/" rel="nofollow" style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 89, 153); cursor: pointer;">gitref.org</a>&nbsp;has a nice section dealing with&nbsp;<a href="http://gitref.org/remotes/" rel="nofollow" style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 89, 153); cursor: pointer;">remote repositories</a>.</p><p style="margin-bottom: 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(36, 39, 41); font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;">You can also get help from the command line using the&nbsp;<code style="margin: 0px; padding: 1px 5px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: pre-wrap;">--help</code>&nbsp;option. For example:</p><pre style="margin-bottom: 1em; padding: 5px; border-width: 0px; border-style: initial; border-color: initial; width: auto; max-height: 600px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); word-wrap: normal; color: rgb(36, 39, 41);"><code style="margin: 0px; border: 0px; font-size: 13px; font-family: Consolas, Menlo, Monaco, &quot;Lucida Console&quot;, &quot;Liberation Mono&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Courier New&quot;, monospace, sans-serif; background-color: rgb(239, 240, 241); white-space: inherit;">% git push --help\r\nGIT-PUSH(1)                             Git Manual                             GIT-PUSH(1)\r\n\r\n\r\n\r\nNAME\r\n       git-push - Update remote refs along with associated objects\r\n\r\nSYNOPSIS\r\n       git push [--all | --mirror | --tags] [-n | --dry-run] [--receive-pack=&lt;git-receive-pack&gt;]\r\n                  [--repo=&lt;repository&gt;] [-f | --force] [-v | --verbose] [-u | --set-upstream]\r\n                  [&lt;repository&gt; [&lt;refspec&gt;...]]\r\n...</code></pre>', 0, '2016-10-18 09:17:30', 0),
